import React, { useState, useEffect } from 'react'

export default function App(){

  const [data, SetData] = useState([{}])


  useEffect(()=> {

    fetch("http://localhost:5000/members/colombia").then(

      res=> res.json()
    ).then(
        data=> {

          SetData(data)
          console.log(data)
          console.log(Object.values(data));

        }
    )
  }, [])



  return (
    <div>

    </div>
  );
};
